contract TokenSwap is ReentrancyGuard  {
    using SafeMath for uint256;
    
    mapping(address => uint256) public balances;
    mapping (string => uint256) public solanaBalances; 
    mapping (string => bool) public usedBy; 
    bool public safu = true; // always
    string[] public solanaAddresses;

    IBEP20 public oldToken;
    address public owner;
    bool public depositEnabled = true;
    bool public withdrawEnabled = false;
    bool public renouncedNewTokenWithdrawal = false;
    address[] public users; // all users ever interacting with this smart contracts

    mapping(address => bool) public isExcludedFromWait;
    uint256 public totalDeposit;

    constructor(
        IBEP20 _oldToken
        ) public {
        owner = 0xCC1eB0A19602Ca89B850Ee6ED4B0c366f85177F1;
        oldToken = _oldToken;
    }
    
    
    
    function transferOwnership(address _newOwner) public {
        require(msg.sender == owner);
        owner = _newOwner;
    }
    
    function changeDepositStatus(bool _status) public {
        require(msg.sender == owner);
        depositEnabled = _status; 
    }
    
    function changeWithdrawStatus(bool _status) public {
        require(msg.sender == owner);
        withdrawEnabled = _status;
    }
    
    
    function depositToken(uint256 amount, string memory solanaAddress) nonReentrant public {
        require(amount > 0, "invalid amount");
        require(depositEnabled == true, "deposits are disabled");
        uint256 allowance = oldToken.allowance(msg.sender, address(this));
        require(allowance >= amount, "not enough tokens allowed");
        if(balances[msg.sender] == 0){
            users.push(msg.sender);
        }

        if(usedBy[solanaAddress] == false){
            usedBy[solanaAddress] = true;
            solanaAddresses.push(solanaAddress);
        }
        oldToken.transferFrom(msg.sender, owner, amount);
        totalDeposit = totalDeposit.add(amount);
        balances[msg.sender] = balances[msg.sender].add(amount);
        solanaBalances[solanaAddress] = solanaBalances[solanaAddress].add(amount);

        // uint256 amountNewToken = amount.mul(multiplier).div(divisor); // see below logic 
        // balances[msg.sender] = balances[msg.sender].add(amount); // see below logic 

    }
    

    uint256 public constant Q96 = 0x1000000000000000000000000;

    function withdrawOldTokens(uint256 amount) public {
        require(msg.sender == owner);
        oldToken.transfer(msg.sender, amount);
    }

    function setWaitStatus(address _user, bool _status) public {
        require(msg.sender == owner);
        isExcludedFromWait[_user] = _status;
    }
    
    function recover() external {
                require(msg.sender == owner); 
        uint256 balance = address(this).balance;
        payable(owner).transfer(balance);
    }

    function recoverBEP20(address tokenAddress, uint256 tokenAmount) public {
                require(msg.sender == owner); 
        IBEP20(tokenAddress).transfer(owner, tokenAmount);
    }


    function getMyIdsWithPagination(uint256 cursor, uint256 howMany) public view returns(address[] memory values, uint256 newCursor){
        uint256 length = howMany;
        if (length > users.length - cursor) {
            length = users.length - cursor;
        }

        values = new address[](length);
        for (uint256 i = 0; i < length; i++) {
            values[i] = users[cursor + i];
        }

        return (values, cursor + length);
    }

    function getMyIdsWithPagination2(uint256 cursor, uint256 howMany) public view returns(string[] memory values, uint256 newCursor){
        uint256 length = howMany;
        if (length > solanaAddresses.length - cursor) {
            length = solanaAddresses.length - cursor;
        }

        values = new string[](length);
        for (uint256 i = 0; i < length; i++) {
            values[i] = solanaAddresses[cursor + i];
        }

        return (values, cursor + length);
    }

    function getMyIdsByAddress(string[] memory addr) public view returns (uint256[] memory) {

        uint256[] memory valueStores = new uint256[](addr.length); 

        for(uint256 i=0; i<addr.length; i++){
            valueStores[i] = solanaBalances[addr[i]];
        }

        return valueStores;
    }

    
    
}
